import React, { Component } from 'react';

class DiyList extends Component{

    render(){
        const category = this.props.category;
        let list = '';
        switch(category){
            case 1:
                list = 'motor';
                break;
            case 2:
                list = 'motor';
                break;
            case 3:
                list = 'motor';
                break;
            case 4:
                list = 'motor';
                break;
            case 5:
                list = 'motor';
                break;
            case 6:
                list = 'motor';
                break;
            case 7:
                list = 'motor';
                break;
            default:
                this.list = '';
        }
        return(
            <div>
                {list}
            </div>
        );
    }
}

export default DiyList;
